import {StyleSheet} from "react-native";

export default function ChatStyles() {
    const style = StyleSheet.create({
        container: {
            flex: 1,
            padding: 24,
            backgroundColor: '#eaeaea',
        },
        title: {
            marginTop: 16,
            paddingVertical: 8,
            borderWidth: 4,
            borderColor: '#20232a',
            borderRadius: 6,
            backgroundColor: 'rgba(255,255,255,.1)',
            color: '#20232a',
            textAlign: 'center',
            fontSize: 30,
            fontWeight: 'bold',
        },
        button: {
            flex: 0.3,
            backgroundColor: '#57068c',
        }
    });
}
